import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <div className="header">
        <ul className="nav">
        <li><h1>I Am a Web Designer</h1></li>
        <li>About</li>
        <li>Project</li>
        <li>Education</li>
        <li>Resume</li>
        <li>Contect</li>
        </ul>
      </div>

      <div className="header"> 
        <img className="headerImage" src="https://cdnb.artstation.com/p/assets/images/images/012/521/703/large/alper-alkan-gadin-3.jpg?1535207487"/>
      </div>
    </div>
  );
}

export default App;
